(function (window, angular) {
    var isDefined = angular.isDefined;

    angular
        .module('GlobalINEEL', [])
        .filter('getInfoServidorDesplegado', function () {
            return function (input, scope) {
                var infoServidorDesplegado = window.infoServidorDesplegado;
                return infoServidorDesplegado;
            }
        })
        .filter('getFichaPersonal', function () {
            return function (input, scope) {
                var fichaPersonal = window.fichaPersonal;
                return fichaPersonal;
            }
        })
      .provider('globalGet', function () {
          this.$get = ['$rootScope', '$window', '$document', '$parse', function ($rootScope, $window, $document, $parse) {
              //var $window = $windowProvider.$get();        
              var webAPIhost = $window.webAPIhost;
              var webAPIhostToken = $window.webAPIhostToken;
              var self = this;
              var getFromLocalStorage = function (key) {
                  if (key === "api") {
                      return webAPIhost;
                  } else if (key === "token") {
                      return webAPIhostToken;
                  } else return "error in get global"
              };

              return {
                  get: getFromLocalStorage
              };
          }];
      })

    .provider('uploadFileACH', function () {
        this.$get = ['$rootScope', '$window', '$document', '$parse', function ($rootScope, $window, $document, $parse) {
            //https://www.w3.org/TR/XMLHttpRequest/#the-upload-attribute 
            var webAPIhost = $window.webAPIhost;
            var webAPIhostToken = $window.webAPIhostToken;
            var self = this;
            var globalName = "";
            var propiedades = {
                file: null,
                ext: "*",
                type: '*',
                size: '8',
                api: null
            };
            var result = {
                message: "Error al procesar su solicitud",
                nameFile: null,
                fullPathFile: null,
                error: true
            };
            var uploadToWebAPI = function (params, done) {
                result = {
                    message: "Error al procesar su solicitud",
                    nameFile: null,
                    fullPathFile: null,
                    error: true
                };
                propiedades.api = params.api || propiedades.api;
                propiedades.file = params.file || propiedades.file;
                propiedades.ext = params.ext || propiedades.ext;
                propiedades.type = params.type || propiedades.type;
                propiedades.size = params.size || propiedades.size;
                var error = false;
                if (propiedades.api === undefined || propiedades.api === null) {
                    result.message = "recurso backend no definido (API)";
                    error = true;
                }
                if (isNaN(propiedades.size)) {
                    result.message = "Error al procesar el tamaño del archivo";
                    error = true;
                }
                // console.log("tamaño:" + parseInt(propiedades.file.size));
                // console.log("máximo " + parseInt(propiedades.size));
                if ((parseInt(propiedades.file.size)) > parseInt(propiedades.size*1024*1024)) {                    
                    result.message = "Tamaño del archivo supera al permitido, tamaño máximo: "+propiedades.size+" MB";
                    error = true;
                }
                if (!(propiedades.file === undefined)) {
                    if (propiedades.file.name.length < 3) {
                        error = true;
                    } else {
                        if (propiedades.ext.length > 1) {
                            var extensiones_permitidas = propiedades.ext.split(";");
                            var extension = propiedades.file.name.slice((propiedades.file.name.lastIndexOf(".") - 1 >>> 0) + 2);
                            var permitida = false;
                            if (extension.length < 1) {
                                error = true;
                                result.message = "El nombre de archivo no es válido";
                            }
                            for (var i = 0; i < extensiones_permitidas.length; i++) {
                                if (extensiones_permitidas[i].toLowerCase() == extension.toLowerCase()) {
                                    permitida = true;
                                    break;
                                }
                            }
                            if (!permitida) {
                                error = true;
                                result.message = "Comprueba la extensión del archivo a subir. \nSólo se pueden subir archivos con extensiones: " + extensiones_permitidas.join();
                            }
                        }
                            
                }
                } else {
                    error = true;
                }


                if (error) {
                    done(transferComplete("Error", true));
                } else {                      
                    var objXhr = new XMLHttpRequest();
                    var data = new FormData();
                    data.append("UploadFiles", propiedades.file);
                    data.append("size", propiedades.file.size);
                    data.append("lastModified", propiedades.file.lastModified);
                    data.append("name", propiedades.file.name);
                    data.append("paraCache", Date.now());
                    globalName = propiedades.file.name;
                    var WebApiPOST = propiedades.api + Date.now();
                    // ADD LISTENERS.
                    objXhr = new XMLHttpRequest();
                    objXhr.open("POST", WebApiPOST, true);
                    // console.log(objXhr);
                    objXhr.onload = function () {
                        done(null, transferComplete(objXhr.response));
                        return result;
                    };
                    objXhr.onerror = function () {
                        done(transferComplete(objXhr.response));
                    };
                    objXhr.send(data);
                    // console.log(data);
                }
            
                // CONFIRMATION.                
                function transferComplete(e, local) {
                    var file = e.replace(/\"/g, "");// objXhr.response;
                    var fileX = file.replace(/\"/g, "");
                    result.fullPathFile = fileX;
                    fileX = fileX.split("/");
                    if (fileX[(fileX.length - 1)].indexOf("error") >= 0 || fileX[(fileX.length - 1)].indexOf("Error") >= 0) {
                        if (!(local != undefined && local)) {
                            result.message = e;
                        }
                        result.error = true;

                    } else {
                        result.nameFile = fileX[(fileX.length - 1)];
                        try{
                            //var tokens = result.nameFile.split("_");
                            var name = "";
                            //for (var i = 2; i < tokens.length; i++) {
                            //    name = name + tokens[i];
                            //}
                            result.nameFile = globalName; //name;
                        }catch (e){}
                        
                        result.error = false;
                    }
                    return result;
                }
                //#endregion CORE upload  -----------------------------------------------------
            };

            return {
                upload: uploadToWebAPI
            };
        }];
    });

})(window, window.angular);

function getRangoDeFechaDefault(addDias, addMes, addAnios) {
    if (addDias == undefined || addDias == null) {
        addDias = 0;
    }
    if (addMes == undefined || addMes == null) {
        addMes = 0;
    }
    if (addAnios == undefined || addAnios == null) {
        addAnios = 0;
    }
    var fechaActualD = new Date();
    var _minDate = new Date(1975, 10, 25);
    var _maxDate = new Date(fechaActualD.getFullYear() + addAnios, fechaActualD.getMonth() + addMes, fechaActualD.getDate() + addDias);
    var datePicker = { FechaOptions: { minDate: _minDate, maxDate: _maxDate, datepickerMode :'year'} };
    return datePicker;
}
function setRangoDeFecha(diaInicio, mesInicio, anioInicio, diaFin, mesFin, anioFin ) {
    if (diaFin == undefined || diaFin == null) {
        diaFin = 0;
    }
    if (mesFin == undefined || mesFin == null) {
        mesFin = 0;
    }
    if (anioFin == undefined || anioFin == null) {
        anioFin = 0;
    }
    if (diaInicio == undefined || diaInicio == null) {
        diaInicio = 0;
    }
    if (mesInicio == undefined || mesInicio == null) {
        mesInicio = 0;
    }
    if (anioInicio == undefined || anioInicio == null) {
        anioInicio = 0;
    }
    var fechaActualD = new Date();
    var _minDate = new Date(anioInicio, mesInicio, diaInicio);
    var _maxDate = new Date(fechaActualD.getFullYear() + anioFin, fechaActualD.getMonth() + mesFin, fechaActualD.getDate() + diaFin);
    var datePicker = { FechaOptions: { minDate: _minDate, maxDate: _maxDate, datepickerMode: 'year' } };
    return datePicker;
}
function RangoDeFechaStart(addDias, addMes, addAnios) {
    if (addDias == undefined || addDias == null) {
        addDias = 1;
    }
    if (addMes == undefined || addMes == null) {
        addMes = 0;
    }
    if (addAnios == undefined || addAnios == null) {
        addAnios = 2006;
    }
    var fechaActualD = new Date();
    var _minDate = new Date(addAnios, addMes, addDias);
    var _maxDate = new Date(fechaActualD.getFullYear(), fechaActualD.getMonth(), fechaActualD.getDate() );
    var datePicker = { FechaOptions: { minDate: _minDate, maxDate: _maxDate } };
    return datePicker;
}
