function generateReportPDF_(nombreFile, titulo, infoAdicional,
    SubTituloIzquierda, SubTituloDerecha, bodyStyles, columnStyles, elementById, imageHeader) {
    debugger;
    var doc = new jsPDF('l', 'pt');

    var header = function (data) {
        doc.setFontSize(20);
        doc.setTextColor(40);
        doc.setFontStyle('normal');
        doc.addImage(imageHeader, 'PNG', data.settings.margin.left-8, 20, 150, 77);
        doc.text(titulo, data.settings.margin.left + 170, 60);

        doc.setFontSize(10);
        doc.text(infoAdicional, 620, 60);

        doc.setFontSize(12);
        doc.text(SubTituloIzquierda, data.settings.margin.left, 100);
        doc.text(SubTituloDerecha, data.settings.margin.left + 500, 100);
        doc.setFontSize(8);
        //doc.text('*** Director de División / ** Gerente de Unidad / @ Asistente Administrativo', data.settings.margin.left, 100);
    };
    var totalPagesExp = "{total_pages_count_string}";
    var footer = function (data) {
        var str = "Página " + data.pageCount;
        // Total page number plugin only available in jspdf v1.0+
        if (typeof doc.putTotalPages === 'function') {
            str = str + " de " + totalPagesExp;
        }
        doc.text(str, data.settings.margin.left, doc.internal.pageSize.height - 30);
    };

    var options = {
        beforePageContent: header,
        afterPageContent: footer,
        margin: { top: 105 },

        styles: { cellPadding: 2, overflow: 'linebreak' },
        headerStyles: {
            rowHeight: 15, fontSize: 8,
            textColor: 255, fillColor: [115, 135, 156], fontStyle: 'bold'
        },
        bodyStyles: bodyStyles,
        columnStyles: columnStyles
    };

    var res = doc.autoTableHtmlToJson(document.getElementById(elementById));
    doc.autoTable(res.columns, res.data, options);
    // Total page number plugin only available in jspdf v1.0+
    if (typeof doc.putTotalPages === 'function') {
        doc.putTotalPages(totalPagesExp);
    }



    doc.save(nombreFile + ".pdf");
}

function removeAccents(data) {
    return data
        .replace(/έ/g, 'ε')
        .replace(/[ύϋΰ]/g, 'υ')
        .replace(/ό/g, 'ο')
        .replace(/ώ/g, 'ω')
        .replace(/ά/g, 'α')
        .replace(/[ίϊΐ]/g, 'ι')
        .replace(/ή/g, 'η')
        .replace(/\n/g, ' ')
        .replace(/á/g, 'a')
        .replace(/é/g, 'e')
        .replace(/í/g, 'i')
        .replace(/ó/g, 'o')
        .replace(/ú/g, 'u')
        .replace(/ê/g, 'e')
        .replace(/î/g, 'i')
        .replace(/ô/g, 'o')
        .replace(/è/g, 'e')
        .replace(/ï/g, 'i')
        .replace(/ü/g, 'u')
        .replace(/ã/g, 'a')
        .replace(/õ/g, 'o')
        .replace(/ç/g, 'c')
        .replace(/ì/g, 'i');
}